import {Rerender} from "../../index";
let index = 334443128;

export const Type_number = () =>{
    console.log(index);
    const changeMinus = () => {
        index--;
    }
    const changePlus = () => {
        index++;

    }
    let baseUrl = `https://cdn3.riastatic.com/photosnew/auto/photo/__${index}f.jpg`;
    return (
        <>
            <div className='Car_app'>
                <img src={baseUrl} alt=""/>
                <div className='Car_app_align_button'>
                    <button onClick={() => changeMinus()}>Left</button>
                    <button onClick={() => changePlus()}>Right</button>
                </div>

            </div>

        </>
    );
}
